INSERT INTO `definitions` (`id`, `entryWord`, `partOfSpeech`, `plural`, `definition`, `originalQuote`, `attributedTo`, `source_id`, `source_date`, `source_description`, `other_sources`, `definitionType`, `keywords`, `categories`, `source`, `context`, `game`, `createdAt`, `updatedAt`) VALUES
(1, 'a', 'n.', 0, '**. The first letter of the atomic alphabet; it stands for \"atom,\" as in the quaint Puritan couplet:  \"In Atom\'s fall/We sinned all.\"', '', 'James J. Farrell', '35', '', '', '', '', 'adam,atom,', '', '', '', 'N', '2022-10-06 14:00:24', '2022-11-05 03:14:27'),
(2, 'A.A.A.A.A.', '', 0, '** A method for being first in a dictionary.', '', 'Maxwell Shane', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(3, 'aardvark', 'n.', 0, 'Aan aanimal that resembles the aanteater.', 'aardvark. Aan aanimal that resembles the aanteater.', 'Evan Esar', '28', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-26 20:25:00'),
(4, 'aardvark', 'n.', 0, 'Aan aanimal aamazingly similar to the aanteater.', '', 'Jared Call', '179', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-11-05 03:17:30'),
(5, 'A.B.', 'n.', 0, 'A degree that means the holder has mastered the first two letters of the alphabet.', '', 'unknown', '9', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(6, 'abalone', 'n.', 0, '** Reference to average T.V. commercial.', '', 'unknown', '1', '', '', '', 'pun', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(7, 'abasement', 'n.', 0, '**, n. A decent and customary mental attitude in the presence of wealth or power.  Peculiarly appropriate in an employee when addressing an employer.', '', 'Ambrose Bierce', '3', '', '', '', 'epigram', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(8, 'abash', 'n.', 0, 'A party.', '', 'unknown', '1', '', '', '', 'pun', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(9, 'abatis', 'n.', 0, '**, n. Rubbish in front of a fort, to prevent the rubbish outside from molesting the rubbish inside.', '', 'Ambrose Bierce', '3', '', '', '', 'epigram', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(10, 'abby-lubber', 'n.', 0, 'A slothful loiterer in a religious house', '', 'Samuel Johnson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(11, 'abdication', 'n.', 0, '**, n. An act whereby a sovereign attests his sense of temperature of the throne.', '', 'Ambrose Bierce *', '3', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(12, 'abdomen', 'n.', 0, 'A bowl-shaped cavity containing the organs of indigestion.', '', 'Evan Esar', '28', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(13, 'abdomen', 'n.', 0, '**, n. The temple of the god Stomach, in whose worship, with sacrificial rights, all true men engage.', '', 'Ambrose Bierce *', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(14, 'abet', 'tr.v.', 0, 'a term which sometimes means to aid but more often to gamble.', '', 'Evan Esar', '28', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(15, 'ability', 'n.', 0, '** is a poor man\'s wealth.', '', 'Matthew Wren', '29', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(16, 'ability', 'n.', 0, '**, n. The natural equipment to accomplish some small part of the meaner ambitions distinquishing able men from dead ones.', '', 'Ambrose Bierce *', '3', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(17, 'ablicate', 'tr.v.', 0, 'To wean from the breast. O.F., to de-milk.', '', 'Samuel Johnson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(18, 'abnegate', 'n.', 0, 'The entrance to Dogpatch.', '', 'unknown', '1', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(19, 'abnormal', 'adj.', 0, '**, adj. Not conforming to standard.  In matters of thought and conduct, to be independent is to be abnormal, to be abnormal is to be detested.  Wherefore the lexicographer adviseth a striving toward a straiter resemblance to the Average Man than he hath to himself.  Whoso attaineth thereto shall have peace, the prospect of death and the hope of Hell.', '', 'Ambrose Bierce', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(20, 'abominable', 'adj.', 0, 'Lousy in a high-class way.', '', 'Leonard L. Levinson', '37', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(21, 'aborigines', 'n.', 0, '**, n. Persons of little worth found cumbering the soul of a newly discovered country.  They soon cease to cumber; they fertilize.', '', 'Ambrose Bierce', '3', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(22, 'abortion', 'n.', 0, 'Dislike of Russian soup.', '', 'unknown', '1', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(23, 'abortive', 'n.', 0, 'That which is born before the due time.', '', 'Samuel Johnson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(24, 'aboveboard', 'adj.', 0, 'In open sight; without artifice or trick. A figurative expression borrowed from gamesters. who, when they put their hands under the table, are changing their cards.', '', 'Samuel Johnson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(25, 'abracadabra', 'n.', 0, 'A superstitious charm against agues.', '', 'Samuel Johnson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(26, 'abrogate', 'tr.v.', 0, '** To take advantage of the fine print in the contract.', '', 'Leonard L. Levinson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(27, 'abrupt', 'adj.', 0, '**, adj. Sudden, without ceremony, like the arrival of a cannon-shot and the departure of the soldier whose interests are most affected by it.', '', 'Ambrose Bierce *', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(28, 'abscond', 'v.i.', 0, '**, v.i. To \"move in a mysterious way,\" commonly with the property of another.', '', 'Ambrose Bierce *', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(29, 'absence', 'n.', 0, 'The enemy of love.', '', 'Italian Proverb', '9', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(30, 'absence', 'n.', 0, 'Death, or worse, to them that love.', '', 'Philip Sidney', '9', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(31, 'absence', 'n.', 0, '**, that common cure of love.', '', 'Miguel de Cervantes', '40', '', '', '', '', 'love,', '', '', '', 'N', '2022-10-06 14:00:24', '2022-11-05 03:27:03'),
(32, 'absence', 'n.', 0, '** That which either makes the heart grow fonder or the mind to forget.', '', 'Leonard L. Levinson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(33, 'absent', 'adj', 0, '**, adj. Peculiarly exposed to the tooth of detraction; vilified; hopelessly in the wrong; superseded in the consideration and affection of another.', '', 'Ambrose Bierce *', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(34, 'absentee', 'n.', 0, '**, n. A person with an income who has had the forthought to remove himself from the sphere of exaction.', '', 'Ambrose Bierce', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(35, 'absenteeism', 'n.', 0, '** Hookey with no fear of the truant officer.', '', 'Leonard L. Levinson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(36, 'absinthe', 'n.', 0, 'What really makes the heart grow fonder.', '', 'Addison Mizner', '37', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(37, 'absolute', 'n.', 0, 'A night in which all cows are black.', '', 'G.W.F. Hegel', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(38, 'absolute', 'adj.', 0, '**, adj. Independent, irresponsible.  An absolute monarchy is one in which the sovereign does as he pleases so long as he pleases the assassins.  Not many absolute monarchies are left, most of them having been replaced by limited monarchies, where the sovereign\'s power for evil (and for good) is greatly curtailed, and by republics, which are governed by chance.', '', 'Ambrose Bierce', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(39, 'abstainer', 'n.', 0, '**, n. A weak person who yields to the temptation of denying himself a pleasure.', '', 'Ambrose Bierce *', '3', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(40, 'abstinence', 'n.', 0, 'The surety of temperance.', '', 'Plato', '9', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(41, 'abstract art', 'n.', 0, '**- The proof that things aren\'t as bad as they are painted.', '', 'Al Boliska', '39', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(42, 'abstract art', 'n.', 0, '** The kind where you are not distracted by reality.', '', 'Leonard L. Levinson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(43, 'abstract noun', 'n.', 0, 'It is the name of something which has no existance, as, goodness.', '', 'unknown', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(44, 'abstract noun', 'n.', 0, 'One that cannot be heard, seen, touched or smelt.', '', 'unknown', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(45, 'absurdity', 'n.', 0, '**, n. A statement or belief manifestly inconsistent with one\'s own opinion.', '', 'Ambrose Bierce', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(46, 'abundance', 'n.', 0, 'Like a tea dance.  A hot-cross fox trot.', '', 'unknown', '1', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(47, 'abuse', 'n.', 0, 'What to try when argument fails.', '', 'Evan Esar', '28', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(48, 'abusive', 'adj.', 0, 'Deceitfula sense little used, yet not improper.', '', 'Samuel Johnson', '37', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(49, 'Academy Awards', 'n.', 0, 'A place where everybody lets off esteem.', 'Academy Awards - A place where everybody lets off esteem.', 'unknown', '57', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-11-05 03:35:20'),
(50, 'accelerator', 'n.', 0, 'A device in an automobile which enables a person to die with his boots on.', '', 'unknown', '9', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(51, 'accent', 'n.', 0, 'The soul of talk; it gives it feeling and verity.', '', 'Jean-Jacques Rousseau', '9', '', '', '', '', '', '', '', '', 'Y', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(52, 'accent', 'n.', 0, '** is the soul of language; it gives to it both feeling and truth.', '', 'Jean-Jacques Rousseau', '29', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(53, 'acceptable failure rate', 'n.', 0, '**. An exceptionable euphemism for the 20 million American deaths that civil defense planners consider \"acceptable\" in a nuclear war.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(54, 'accident', 'n.', 0, 'Where presence of mind is good but absence of body is better.', '', 'Evan Esar', '28', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(55, 'accident', 'n.', 0, '**, n. An inevitable occurence due to the action of immutable natural laws.', '', 'Ambrose Bierce', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(56, 'accidental war', 'n.', 0, '**. A war in which the nuclear weapons that have been developed and deployed since 1945 inadvertently accomplish what they are designed to do. As Leon Wiesltier says, \"A balance of terror is now threatened by a balance of error.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(57, 'accomplice', 'n.', 0, '**, n. One associated with another in a crime, having guilty knowledge and complicity, as an attorney who defends a criminal, knowing him guilty.  This view of the attorney\'s position in the matter has not hitherto commanded the assent of attorneys, no one having offered them a fee for assenting.', '', 'Ambrose Bierce', '3', '', '', '', '', '', '', '', '', 'N', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
