(417, 'Armageddon chambers', 'n.', 0, '**. Subterranean hellholes in which the Defense Nuclear Agency simulates \"the nuclear environment\" to test the survivability of the American war machine. Aurora, for example, is an Armageddon chamber located in White Oak, Maryland, which irradiates weapons with 10 million volts of gamma rays to see if machines survive \"enhanced radiation\" better than people do.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
