(421, 'arms', 'n.', 0, '**. From the root that means \"to join or fit together,\" arms are weapons that blow us apart or keep us apart. Nuclear arms are specialized extensions of human arms, but they are not as versatile, because, as the placard says, \"You can\'t hug your baby with nuclear arms.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(422, 'arms control', 'n.', 0, '**. Semantic substitution for the obsolete \"disarmament,\" suggesting that we can control our weapons without destroying them. Arms control agreements generally control obsolete weapons systems, while permitting the uncontrolled proliferation of new and more dangerous systems. They usually ignore the dictum of retired Admiral Noel Gayler, who said that \"the way to get rid of nuclear weapons is to get rid of nuclear weapons.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(423, 'Arms Control and Disarmament Agency (ACDA)', 'n.', 0, '**. An institutional eunuch established in 1961 to emasculate critics of the arms race just as the United States began its unprecedented build-up of nuclear weapons. The ACDA speaks for arms control in the government, but with its minuscule budget and hawkish directors, it speaks softly without a big stick. One ACDA director, Kenneth Adelman, echoed many of his predecessors when he said, \"My policy would be to {conduct arms negotiations} for political reasons. But I think it\'s a sham.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(424, 'arms race', 'n.', 0, '**. A contest of two or more nations to contrive more and better ways of killing people; a race without winners, but not without losers; the race to the finish _ literally.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
