(453, 'atoms for peace', 'n.', 0, '**. The silver lining in the mushroom cloud; an American program to use atomic energy to produce electricity, among other things. Since 1953, the program has produced about 80 nuclear reactors, each of which is a prime target in a nuclear war; an enrichment program to produce fissionable uranium, plutonium, deuterium, and tritium, all of which are bomb-grade material; a multi-billion dollar industry that would collapse without government subsidy and insurance; and kilotons of waste that remains radioactive and lethal for thousands of years.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
