(744, 'bias', 'n.', 0, '**. The bent of missiles to miss, which dismisses the certainty of experts bent on first-strike capability; a mathematical measure, like circular error probable, representing the distance between the center of a cluster of impact points and the intended target, as established by test results, which are themselves misleading, since they occur on an East-West trajectory, instead of the North-South polar route of real missiles. Besides gravitational and electromagnetic idiosyncrasies, bias can result from faulty programming, hardware defects, or weather conditions at the point of re-entry. The result is that the only thing we know for sure is that we\'re not sure how accurate our missiles will be in a real-death situation.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
