(1245, 'cold war', 'n.', 0, '**. The polar turbulence located between the US and the USSR which controls world whetherwhether or not there will still be a world tomorrow. This cold front of World War II developed over Eastern Europe, but now affects the entire international atmosphere. Its storm systems are economic, ideological, and military; the temperate characteristics of the military storm are maintained by strategic brainstorming that avoids precipitous action because of the mutually assured destruction of deterrence and proxy wars like Korea, Vietnam, and Central America. The coldness of the Cold War confuses even military meteorologists. The colder it gets, the closer it approaches the boiling point. And a thaw seems to reduce the forecast of hot war. The hotness of hot war is, however, unequivocable; the temperature of a nuclear fireball reaches several million degrees Fahrenheit.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1246, 'collaboration', 'n.', 0, 'What every sin is the result of.', '', 'Evan Esar', '28', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
