(1248, 'collateral damage', 'n.', 0, '**. Euphemism for the incidental mass murder of innocent civilians, specifically those people killed and property damaged in a counter-force attack. Depending on the type of attack and sheltering preparations, a U.S. counterforce attack on the USSR would cause collateral damage of 3.7 million to 27.7 million lives.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
