(1259, 'combat casualty prediction code', 'n.', 0, '**. A measure of the nuclear war fighting capability of human beings, with which the Armed Forces Radiobiology Research Institute estimates the effects of radiation exposure on the \"combat effectiveness\" of American soldiers. The code shows, for example, that tank loaders exposed to 1000 rads of radiation would remain \"combat effective\" for about 100 minutes; nausea, vomiting, and fatigue would render them \"combat ineffective\" within a day, and they would die within a month.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
