(1354, 'counterforce', 'n.', 0, '**. Offensive strategy with a defensive sound, specifically the targeting of the enemy\'s missiles, bombers, and military installations. Designed to destroy these weapons and command posts before their attack, counterforce weapons appear in scenarios for a pre-emptive first strike or protracted nuclear war. Counterforce calms the moral qualms of those who oppose the indiscriminate killing of innocent people in countervalue targeting, but it does not calm the qualms of the enemy, who interprets counterforce capability as evidence of offensive intentions. Nor does it save the innocent civilians since they may die as collateral damage in a counterforce strike. But counterforce does provide a rationale for the arms race, since both sides need counterforce weapons to target the other side\'s counterforce weapons, which threaten the survivability of the retaliatory strike that makes deterrence \"work.\" Discriminate aiming [or counterforce targeting] in a nuclear war is logically and morally equivalent to using a sledge hammer to kill a fly on someone\'s head,\" says Robert Gardiner. \"It is surely possible to kill a fly in this manner; but we must ask: Is it also possible, by any stretch of the imagination, to claim that the ensuing death of the person was only incidental to the death of the fly, or that smashing of the skull was not intended in the intention of the act?\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1355, 'counterirritant', 'n.', 0, 'A woman who shops all day and doesn\'t buy anything.', '', 'unknown', '1', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1356, 'countervailing strategy', 'n.', 0, '**. The empire\'s new clothes for flexible response, countervailing strategy was an unavailing 1980 political strategy of President Jimmy Carter, promising conventional or counterforce capability to match any level of Soviet strike.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1357, 'countervalue', 'n.', 0, '**. The strategic foundation of deterrence, specifically missiles targeted to destroy enemy cities, civilians, and civilization. Reliance on counter value deterrence (or massive retaliation) led a 1960s Pentagon analyst to the conclusion that \"weapons that kill people are more peace-loving than weapons that kill weapons\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
