(1380, 'crisis stability', 'n.', 0, '**. an oxymoron denoting the aplomb with which nations greet a crisis when their strategic forces are impervious to preemption. First-strike weapons threaten crisis stability with use-them-or-lose-them options.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
