(1467, 'democracy', 'n.', 0, '**. The theory that two thieves will steal less than one, and three less than two, and four less than three, and so on ad infinitum;  the theory that the common people know what they want and deserve to get it good and hard.', '', 'H.L. Mencken', '47', '', 'A Book of Burlesques', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
