(1473, 'democracy', 'n.', 0, 'Simply the bludgeoning of the people, by the people, for the people.', 'Democracy means simply the bludgeoning of the people, by the people, for the people.', 'Oscar Wilde', '28', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-11-04 22:27:25'),
(1474, 'democracy', 'n.', 0, '**. That system of governement of, buy, and form (sic) the people by which citizens elect representatives who vote to create an atomic autocracy which uses classification and clearance systems to conceal nuclear policy from the citizens.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
