(1478, 'dense pack', 'n.', 0, '**. The pack of lies and untested assumptions that supported MX deployment in clusters of superhardened missile silos, specifically the assumptions that incoming Soviet warheads would commit fratricide, that the MX missiles would not be harmed by such explosions, and that the Soviets wouldn\'t use time-delay weapons or bigger bombs.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
