(1487, 'department of defense', 'n.', 0, '**. Cabinet agency charged with the defense of the indefensible; new name (1947) for the Department of War; likely inspiration for Orwell\'s Ministry of Peace. Unfortunately, defense is one thing this department does not provide, because there is no effective defense against ballistic missiles, and because, as Lewis Mumford said, \"There is no defense against genocide by counter genocide.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
