(1497, 'destabilizing weapon', 'n.', 1, '**. Those weapons that, because of accuracy and speed, tempt nations to first-strike options or launch-on-warning responses. Among the destabilizing weapons the United States plans to deploy in the 1980s are the MX missile, Trident II, and Pershing II.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1498, 'destiny', 'n.', 0, '**, n. A tyrant\'s authority for crime and a fool\'s excuse for failure.', '', 'Ambrose Bierce', '3', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1499, 'detente', 'n.', 0, '**. An interval of reduced tensions in the Cold War (1972-1979) in which the Soviet Union added 5,000 warheads, 3 new land based missiles, a new submarine, new submarine-launched missile systems and MIRVed missiles to its arsenal, and the United States, not to be outdone in its expressions of amity, added the trident submarine, the Trident missile system, the long-range cruise missile, and 5,500 new warheads, many on MIRVed missiles. As \"news-speak,\" detente \"meets all the requirements,\" notes journalist Paul Braaten. \"It is French, and there fore impossible to pronounce with any degree of certainty; it is short enough to fit in a one-column headline, should that unfortunate necessity arise, yet full-bodied enough to add solidity and a sense of importance to a four column head-cum-kicker; its meaning is only hazily grasped by its users, and, perhaps most important of all, it means nothing whatever to the reader.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1500, 'deterrence', 'n.', 0, '**. The international version of winning through intimidation; the policy of preventing enemy attack by threatening the same; preserving peace by preparing for death; a mutual genocide pact to prevent aggression.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
