(1524, 'disarmament', 'n.', 0, '**. The process of negotiation and agreement about levels of nuclear armament, so called because such talks disarm critics of the arms race. For example, an article on the start of START talks noted that \"the very fact that the superpowers are talking directly gives Western governments some relief from the ferment that has been building publicly over nuclear armaments.\" Some literalists have interpreted this word to mean the reduction of weapons or delivery systems; to prevent such unwarranted confusion, the preferred term is now \"arms control.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
