(1551, 'domino theory', 'n.', 0, 'A 1954 analysis of international relations by President Eisenhower, who observed that \"you have a row of dominoes set up, and you knock over the first one, and what would happen to the last one is the certainty that it would go over quickly. So you have a beginning of a disintegration that would have the most profound influences.\" With his characteristic simple-mindedness, President Reagan stated the maxim more clearly:  \"Let\'s not delude ourselves; the Soviet Union underlies all the unrest in the world that\'s going on. If they weren\'t engaged in this game of dominoes, there wouldnt be any hot spots in the world.\"<br><br>Unfortunately, in the game of dominoes, you don\'t have a row of dominoes set up, you should ask who set them up, and why they are spaced so closely. In the instance of Vietnam, French colonialism set up the dominoes, and nationalism knocked them down. In Central America, injustice and exploitation set them up, and hope is knocking them down. But dominoes is in fact a game of matching, in which you have to match the opponent to win. If the opponent has popular and political support, you must match it with popular and political moves. In such a situation, military moves lead only to the boneyard.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1552, 'doomsday', 'n.', 0, '**. Today and tomorrow.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1553, 'doomsday clock', 'n.', 0, '**. The clock on the front cover of the Bulletin of the Atomic Scientists which tells the time of our lives. Set first at 7 minutes before midnight in 1947, it has been as close as 2 minutes from 1953 to 1963, and as far as 12 minutes in 1963 and 1972. It stands now at 3 minutes to midnight.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
