(1557, 'double effect', 'n.', 0, '**. The doublethink that allows some moralists to justify the collateral damage of counterforce nuclear attack as a mere part of the dual effect of the bomb on military and civilian elements of the society.<br><br>In their May 1983 pastoral letter, the Roman Catholic bishops of the United States commented on this notion:  \"We are told that some weapons are designed for purely \'counterforce\' use against military forces and targets. The moral issue, however, is not resolved by the design of weapons or the planned intention for use; there are also consequences which must be assessed. It would be a perverted political policy or moral casuistry which tried to justify a weapon which \'indirectly\' or \'unintentionally\' killed a million innocent people because they happened to live near a \'militarily significant target.\'\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
