(1559, 'doublethink', 'n.', 0, '**. Hypocristic hypocrisy; according to Orwell, \"the power of holding two contradictory beliefs in one\'s mind simultaneously, and accepting both of them.\" \"In the double think world,\" claims Haig Bosmajian, \"\'War is Peace\' and an intercontinental weapon devised to kill and destroy is a \'Peacekeeper.\' In the doublethink world, \"Freedom is Slavery\' and totalitarian countries are part of the Free World. In the doublethink world, \"Ignorance is Strength\' and increasing censorship, less access to information, increases strength.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
