(1746, 'fallout', 'n.', 0, '**. Crop dusting for people; radioactive particles of people and places raised by a ground burst that \"fall in\" to cities, suburbs, farms, lakes and streams. The more experienced Japanese call fallout \"ashes of death.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1747, 'fallout shelter', 'n.', 0, '**. An advanced form of pre-need funeral planning, in which people inter themselves to wait for death, which will come sooner, in the form of blast and thermal effects; later, in asphyxiation caused as the firestorm sucks oxygen out of the crypt; or ultimately, in starvation, as nuclear winter and fallout kill crops and contaminate cropland. A mausoleum for the living dead.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
