(1772, 'fear', 'n.', 0, '**. The scare tissue of the nuclear wound, cause and consequence of the arms race. \"It is part of the general pattern of misguided policy,\" claimed General Douglas MacArthur, \"That our country is geared to an arms economy which was bred in an artificially induced psychosis of war hysteria and nurtured upon an incessant propaganda of fear.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
