(1774, 'Federal Emergency Management Agency (FEMA)', 'n.', 0, '**. The shades of Pollyanna; an institutional paragon of rose-colored asses who try to make nuclear war look both livable and lovable. A 1982 FEMA White House \"Food Vulnerability Briefing,\" for example, considered the effects of a 1,200-warhead, 6,000-megaton attack on the U.S. agricultural system. The good news was that, although 46 percent of the U.S. population would perish, survival rates would be better for livestock and the rural population. Fortunately, too, \"the number of survivors during the first sixty days following an attack drops over time. Thus, those who are doomed to die will be consumers for only part of that time.\" Unfortunately, however, nuclear war could disrupt food processing and distribution. FEMA notes that \"the margin of safety in the ratio of potentially surviving processing capabilities to surviving population is razor thin.\" Too, the success of FEMA\'s post-attack farm scenario depends on the failure of crisis relocation. \"Ironically,\" the report notes, \"the relatively favorable balance between population and livestock and poultry survival rates expected under current Civil Defense capabilities could disappear under an effective crisis relocation plan.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
