(1785, 'fine', 'n.', 0, '**. A bribe paid by a rich man to escape the lawful penalty of his crime.  In China such bribes are paid to the judge personally; in America they are paid to him as agent for the public.  But it makes no difference to the men who pay them  nor to the men who can\'t pay them.', '', 'H.L. Mencken', '47', '', 'A Book of Burlesques', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
