(1788, 'fireball', 'n.', 0, '**. The helliosphere of a nuclear explosion, whose fire and brimstone create an earthly inferno. The fireball of a 25 megaton bomb reaches temperatures of 200,000,000 degrees Fahrenheit, vaporizes everything within 6 miles, incinerates everything within a 30-mile radius, and burns people within 80 miles. Anyone glancing at the fireball, a normal human reaction, would suffers retinal burns and blindnessas far away as 40 miles.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(1789, 'firebreak', 'n.', 0, '**. The space between the rungs of the escalation ladder that theoretically makes it possible to use it as a fire escape. The most important firebreak is between conventional and nuclear war; NATO\'s first use policy makes it a firetrap.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
