(1791, 'firestorm', 'n.', 0, '**. An infernal combustion engine that drives a holocaust, in the root sense of the word, \"burnt whole.\" The fireball of an urban nuclear explosion sets off gas stations, natural gas lines oil storage tanks, automobile gas tanks, and other flash points, as well as less flammable materials like wood, cloth, and paper, As these fires burn, the hot air rises, cooler air is whipped into the firezone, and hurricane-force winds bring more oxygen to fan the flames. Temperatures rise to 1,600 degrees Fahrenheit', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
