(1794, 'first use', 'n.', 0, '**. The first firing of nuclear weapons, strategic or tactical, under any circumstances. In 1981, Soviet Premier Breshnev committed the USSR to a \"no-first-use\"policy, but the US and NATO rely on the first use of tactical weapons to stop a Soviet onslaught in Europe. Abbreviated \"fuse,\" because this first fire could very well detonate the plant.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
