(1798, 'fission', 'n.', 0, '**. A process of bombarding atomic nuclei in order to produce enough energy to bombard people. Neutrons split the nucleus of heavy atoms of uranium or plutonium, releasing more neutrons and the immense force that normally binds atoms together. At Armageddon, God will probably post a sign on the earth, saying simply, \"Gone fission.\"', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
