(2453, 'limited nuclear war', 'n.', 0, '**.  A comfortably qualified expression for any atomic engagement with survivors; thus a war limited only by the inhibition or inability to annihilate all life. Two popular scenarios for limited nuclear war are, first, a war that devastates only the continent of Europe, and second, a war in which the superpowers mutually restrain themselves to selective strikes. In the first instance, the war will not seem limited to those within its limits. In the second instance, as many as 20 million people are expected to die in both countries.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
(2454, 'limited test ban', 'n.', 0, '**. A 1963 agreement between the US and USSR to prohibit nuclear tests in the atmosphere, above the atmosphere, or in the seas in order to prevent the proliferation of nuclear weapons. The treaty was \"limited,\" not so much because it limited testing, but because it did not limit testing underground. In fact, in order to secure the support of the Joint Chiefs of Staff, President John Kennedy had to promise to continue testing, and both the US and the USSR accelerated their test programs after 1963.', '', 'James J. Farrell', '35', '', '', '', '', '', '', '', '', 'U', '2022-10-06 14:00:24', '2022-10-06 14:00:24'),
